import React from "react";
import { input, Popover, Radio, Modal, message } from "antd";
import {
  ArrowdownOulined,
  DownOutlined,
  SettingOutlined,
} from "@ant-design/icons";

function Swap() {
  const settings = (
    <>
      <div>Slippage Tolernce</div>
      <div>
        <Radio.Group>
          <Radio.Button></Radio.Button>
        </Radio.Group>
      </div>
    </>
  );
  return <div>Swap</div>;
}

export default Swap;
